import './SimpleInterestCalc.css';
import Finance from 'financejs';
import React, { Component } from 'react';
import { withStyles } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';

const finance = new Finance();

class SimpleInterestCalc extends Component {
      constructor() {
        super();
        this.def = {
              principal: 0,
              annualContributions: 1500,
              interestRate: 12,
              numYears: 30
            };
      }

      componentDidMount() {
      }

      render() {
        var toolTip = '<span className="help"><a href="" class="link">?</a></span>';

        return (
            <Box
              sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex'}}
            >
            <div className="container">
              <div id="CalcDataEntry">
                <table className="mycurve-data">
                <tbody>
                  <tr>
                    <td>
                      <label>Principal {{ toolTip }}</label>
                      <input  type="number"
                              id="principal"
                              placeholder={this.def.principal} />
                    </td>
                    <td>
                      <label>Annual Contributions {{ toolTip }}</label>
                      <input  type="number"
                              id="annual_contributions"
                              placeholder={this.def.annualContributions} />
                    </td>
                  </tr>
                  <tr>
                    <td>
                      <label>Interest Rate (%) {{ toolTip }}</label>
                      <input  type="number"
                              id="interest_rate"
                              placeholder={this.def.interestRate} />
                    </td>
                    <td>
                      <label>Number of Years {{ toolTip }}</label>
                      <input  type="number"
                              id="num_of_years"
                              placeholder={this.def.numYears} />
                    </td>
                  </tr>
                  </tbody>
                </table>
                <Button className="calc-btn"
                        variant="contained"
                        size="large"
                >
                  Calculate
                </Button>
              </div>
            </div>
          </Box>
        )
      }

  }


export default SimpleInterestCalc;
